import React from "react";
import AppContext from '../SwapiServiceContext'; 

const withSwapiService = Wrapped => {  
  return props => {
    return (
      <AppContext.Consumer>
        {swapiService => {
          return <Wrapped {...props} swapiService={swapiService}></Wrapped>;
        }}
      </AppContext.Consumer>
    );
  };
};


export default withSwapiService;
